Dapp/MoneyTransfer.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.15;



contract  MoneyTransfer {


    uint256 public amount;
    uint256 public TotalFunds;
    address receiver ;
    uint256 constant limit = 2000;
    uint day = 24 hours;
    uint256 public totalWeekTransactions;
    uint maxTransaction;
    uint minTransaction;
    uint256[] countries ; 
    uint256 public receiverFunds;
    string public message;
    string public cardNumber ;
    string public cvv;
    uint256 public TotalAmount ;
uint public firstTransferTime;
    uint public countTransfer ;



    constructor (uint256 _totalFunds, string memory _cardNumber, string memory _cvv){
        cardNumber = _cardNumber;
        cvv = _cvv;
        TotalFunds = _totalFunds;
    }



    uint public callCount = 0 ;

    function sendMoney( uint _amount, address _receiver) public m_validAddress(_receiver) m_checkCard m_transferLimit{
        receiver = _receiver;
        amount = _amount;
        


                
                      callCount += 1;
                

                 if(TotalFunds > 0 && TotalFunds > amount){
                    TotalFunds -= amount;
                    TotalAmount += amount;
                     
                    
                    message = "Transfer completed";
                 }
                
    
            }


    // function getReceiverFunds()public returns(uint256) {
    //     if(sendMoney()){
            
    //     }
        
    // }

    modifier m_validAddress(address _addr) {
        receiver = _addr;
        require(_addr != address(0), " This address doesn't exists");

        _;
    }

    modifier m_checkCard() {
         
        require(bytes(cardNumber).length == 8 && bytes(cvv).length == 3, "No valid credit card");
        require(TotalFunds > 0 && TotalFunds > amount,"Not enough funds");


        _;

    }

    modifier m_transferLimit(){
         
        

        require (TotalAmount <= 2500 , "You reached the limit");

        require(callCount <= 5 && block.timestamp >= (firstTransferTime + 30 seconds),"you cannot make more than 5 transactions per day");
      
        _;
         

      
    }

    
}

